import codecs


def recounstruct(pairs, k, d):
    out = pairs[0][0]
    for i in range(1, len(pairs)):
        out += pairs[i][0][-1]
    s = 0
    if len(out) - (2 * k + d) < 0:
        s = abs(len(out) - (2 * k + d))
    else:
        s = k
    j = max(len(out) - (2 * k + d), 0)

    out += pairs[j][1][:-s]
    for i in range(j + 1, len(pairs)):
        out += pairs[i][1][-1]
    return out

print (recounstruct(pairs, k, d))
